import { useState } from 'react';
import Car from './Components/Car';

const App = () => {
let carList = [
  {
    car:'Audi'
  },
  {
    car:'BMW'
  },
  {
    car:'Porsche'
  }
]

  return (
    <div className="App">
      <input type="text" />
      <button></button>
      {carList.map(e=><Car key={e.car} name={e.car}/>)}
    </div>
  );
}

export default App;
